import React from "react";
import BotCard from "./BotCard";

function BotCollection({ bots, enlistBot, showBotSpecs, deleteBot }) {
  return (
    <div className="ui four column grid">
      <div className="row">
        {bots.map((bot) => (
          <BotCard
            key={bot.id}
            bot={bot}
            enlistBot={enlistBot}
            showBotSpecs={showBotSpecs}
            deleteBot={deleteBot}
          />
        ))}
      </div>
    </div>
  );
}

export default BotCollection;
